// src/pages/About.js
import React from 'react';
import Collapse from '../components/collapse';

function About() {
  return (
    <div className="about">
      <Collapse title="Fibilité">
        <p>Fiabilité.</p>
      </Collapse>
      <Collapse >
        <p>Respect</p>
      </Collapse>
      <Collapse>
        <p>Service</p>
      </Collapse>
      <Collapse>
        <p>Sécurité</p>
      </Collapse>
    </div>
  );
}

export default About;
